import React, { useEffect, useState } from 'react';
import {TableV2} from './features/table/TableV2';
import {Counter} from './features/counter/Counter'
import axios from 'axios';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import {setSensorData, selectTable} from './features/table/tableSlice';
import {useSelector, useDispatch} from 'react-redux';


function App() {
  // const [sensors, setsensors] = useState([]);

  const count = useSelector(selectTable);

  const dispatch = useDispatch();

  const fetchData = async ()=>{
    try{
      const response = await axios.get('http://localhost:5000/listings');
      const SensorData = await response.data;
      dispatch(setSensorData(SensorData));
    }catch(e){
      console.log(e.stack);
    }
  }

  useEffect( ()=> {fetchData()},[]);

  console.log(count);

  const columns = React.useMemo(
    () => [
      {
        Header: 'Name',
        accessor: 'name',
      },
      {
        Header: 'Long',
        accessor: 'long',
      },
      {
        Header: 'Lat',
        accessor: 'lat',
      },
      {
        Header: 'Temperature',
        accessor: 'temperature',
      },
      {
        Header: 'Humidity',
        accessor: 'humidity',
      },
      {
        Header: 'pH',
        accessor: 'pH',
      },
      {
        Header: 'Pressure',
        accessor: 'pressure',
      },
      {
        Header: 'CO2',
        accessor: 'co2',
      }
    ],
    []
  )

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <Counter />
        {/* <Styles> */}

        <TableV2 columns={columns} />
        {/* </Styles> */}
      </header>
    </div>
  );
}

export default App;
